fields.body:
{% load evaluation_filters %}
(English version below)


Sehr geehrte Dozentin, sehr geehrter Dozent,

die folgenden Evaluierungsergebnisse wurden soeben veröffentlicht:
{% for evaluation in evaluations|order_by:"full_name_de" %} - {{ evaluation.full_name_de }}
{% endfor %}
Die Ergebnisse können auf EvaP{% if not user.needs_login_key %} (https://evap.hpi.de){% endif %} eingesehen werden.{% if user.needs_login_key and login_url %} Hier klicken zum Anmelden: {{ login_url }}{% elif user.needs_login_key %} Ein Link zum Anmelden wird per E-Mail zugesendet.{% endif %}

Bei Fragen und Rückmeldungen stehen wir gerne zur Verfügung (evaluierung@hpi.de).

Freundliche Grüße,
das Evaluierungsteam

(Dies ist eine automatisch versendete E-Mail.)


--


Dear users of the evaluation platform,

the results of the following evaluations have just been published:
{% for evaluation in evaluations|order_by:"full_name_en" %} - {{ evaluation.full_name_en }}
{% endfor %}
You can view the results on EvaP{% if not user.needs_login_key %} (https://evap.hpi.de){% endif %}.{% if user.needs_login_key and login_url %} Click here to login: {{ login_url }}{% elif user.needs_login_key %} We will send you a one-time login URL in a separate email.{% endif %}

If you have any questions or feedback, please let us know (evaluierung@hpi.de).

Kind regards,
the Evaluation Team

(This is an automated message.)

{% load evaluation_filters %}
(English version below)


Hallo {{ user.first_name }},

für die folgenden Evaluierungen hat die Evaluierungsphase begonnen:
{% for evaluation in evaluations|order_by:"full_name_de" %}    - {{ evaluation.full_name_de }}
{% endfor %}
Du kannst dein Feedback auf EvaP{% if not user.needs_login_key %} (https://evap.hpi.de){% endif %} abgeben, die Dozenten und wir freuen uns über deine Bewertung.

{% if user.needs_login_key %}Klicke hier, um dich anzumelden: {{ login_url }}
{% endif %}{% if due_evaluations|length > 1%}Diese Evaluierungen warten auf deine Bewertung:
{% for evaluation, due_in_days in due_evaluations|order_due_evaluations_by:"full_name_de" %}    - {{ evaluation.full_name_de }} (endet {% if due_in_days == 0 %}heute{% elif due_in_days == 1 %}morgen{% else %}in {{ due_in_days }} Tagen{% endif %})
{% endfor %}{% endif %}
Vielen Dank für deine Mühe und viele Grüße,
das Evaluierungsteam

P.S.: Bei Fragen und Rückmeldungen kannst du dich jederzeit an uns wenden (evaluierung@hpi.de).

(Dies ist eine automatisch versendete E-Mail.)


--


Dear {{ user.first_name }},

The evaluation period for the following courses just started:
{% for evaluation in evaluations|order_by:"full_name_en" %}    - {{ evaluation.full_name_en }}
{% endfor %}
You can evaluate them on EvaP{% if not user.needs_login_key %} (https://evap.hpi.de){% endif %}. The lecturers and we are looking forward to receive your feedback.

{% if user.needs_login_key %}Click here to login: {{ login_url }}
{% endif %}{% if due_evaluations|length > 1%}These evaluations are waiting for your feedback:
{% for evaluation, due_in_days in due_evaluations|order_due_evaluations_by:"full_name_en" %}    - {{ evaluation.full_name_en }} (ends {% if due_in_days == 0 %}today{% elif due_in_days == 1 %}tomorrow{% else %}in {{ due_in_days }} days{% endif %})
{% endfor %}{% endif %}
Thank you very much for your efforts and kind regards,
the evaluation team

PS: If you have any questions or feedback, please let us know (evaluierung@hpi.de).

(This is an automated message.)

